import React from "react";
import { useSelector } from "react-redux";

const Home = () => {
  const userEmail = useSelector((state) => state.userDatauserEmail);
  console.log(userEmail);
  return (
    <div>
      <h3 className="text-center">Welcome to Home</h3>
    </div>
  );
};

export default Home;
